INSERT INTO ascendco.sonar_backlog (            backlog,            backlog_date,            backlog_day_name,            backlog_day_of_week,            backlog_hour_bin,            backlog_hour_of_day,            backlog_local,            backlog_dts,            date_and_hour,            date_time,            facility_id,            facility_name,            hsys_id,            hsys_name,            inst_backlog)      SELECT              expanded_data."Backlog",             expanded_data."Backlog_Date",             expanded_data."Backlog_DayName",             expanded_data."Backlog_DayOfWeek",             expanded_data."Backlog_HourBin",             expanded_data."Backlog_HourOfDay",             expanded_data."Backlog_Local",             expanded_data."BacklogDTS",             expanded_data."DateAndHour",             expanded_data."DateTime",             expanded_data."FacilityID",             expanded_data."FacilityName",             expanded_data."HsysID",             expanded_data."HsysName",             expanded_data."InstBacklog"        FROM domo_passthrough  CROSS JOIN jsonb_to_recordset(domo_passthrough.data) as expanded_data (             "Backlog" int4,             "Backlog_Date" timestamp,             "Backlog_DayName" citext,             "Backlog_DayOfWeek" int4,             "Backlog_HourBin" int4,             "Backlog_HourOfDay" int4,             "Backlog_Local" timestamp,             "BacklogDTS" timestamp,             "DateAndHour" citext,             "DateTime" timestamp,             "FacilityID" uuid,             "FacilityName" citext,             "HsysID" uuid,             "HsysName" citext,             "InstBacklog" int4)       WHERE dataset_name = 'Sonar_BackLog_PG' AND             view_version = '1'